import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';
import Login from './Login';  // Create this new Login page component
import './App.css';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} /> {/* The Home component will be the default route */}
        <Route path="/login" element={<Login />} /> {/* The Login page route */}
      </Routes>
    </Router>
  );
};

export default App;
